#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

#ifdef __cplusplus
extern "C" {
#endif

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) return 0;

  // http_status ranges from 100 to 511
  enum http_status status = static_cast<enum http_status>(100 + (data[0] % (511 - 100 + 1)));
  const char *status_str = http_status_str(status);

  (void)status_str; // Suppress unused variable warning

  return 0;
}

#ifdef __cplusplus
}
#endif

#include "http_parser.h"
#include <stdint.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) return 0;

  // Use the first byte of data to determine the http_status value
  enum http_status status = (enum http_status)(data[0] % (HTTP_STATUS_NETWORK_AUTHENTICATION_REQUIRED + 1));

  // Call the function under test
  const char *status_str = http_status_str(status);

  return 0;
}
